gkS(){return"\u0906\u0909\u091f\u0932\u093e\u0907\u0928\u094d\u0921 \u092c\u091f\u0923\u0947 \u0926\u093e\u092c\u0932\u094d\u092f\u093e\u0928\u0902\u0924\u0930 \u0905\u092a\u093e\u0930\u0926\u0930\u094d\u0936\u0915 \u0939\u094b\u0924\u093e\u0924 \u0906\u0923\u093f \u0935\u0930 \u0909\u091a\u091a\u0932\u0940 \u091c\u093e\u0924\u093e\u0924. \u090f\u0916\u093e\u0926\u0940 \u092a\u0930\u094d\u092f\u093e\u092f\u0940, \u0926\u0941\u0938\u0930\u0940 \u0915\u094d\u0930\u093f\u092f\u093e \u0926\u093e\u0916\u0935\u0923\u094d\u092f\u093e\u0938\u093e\u0920\u0940 \u0924\u0947 \u0938\u0939\u0938\u093e \u0909\u0902\u091a \u092c\u091f\u0923\u093e\u0902\u0938\u094b\u092c\u0924 \u091c\u094b\u0921\u0932\u0940 \u091c\u093e\u0924\u093e\u0924."},
