gkg(){return"\u0972\u092a\u094d\u0932\u093f\u0915\u0947\u0936\u0928\u092e\u0927\u094d\u092f\u0947 \u092a\u094d\u0930\u093e\u0925\u092e\u093f\u0915 \u0915\u094d\u0930\u093f\u092f\u093e \u0915\u0930\u0923\u094d\u092f\u093e\u091a\u0947 \u0938\u0942\u091a\u093f\u0924 \u0915\u0930\u0923\u094d\u092f\u093e\u0938\u093e\u0920\u0940 \u0906\u0936\u092f\u093e\u0935\u0930 \u092b\u093f\u0930\u0923\u093e\u0930\u0947 \u092b\u094d\u0932\u094b\u091f\u093f\u0902\u0917 \u0972\u0915\u094d\u0936\u0928 \u092c\u091f\u0923 \u0939\u0947 \u0917\u094b\u0932\u093e\u0915\u093e\u0930 \u0906\u092f\u0915\u0928 \u092c\u091f\u0923 \u0906\u0939\u0947."},
