giY(){return"\u091a\u093f\u092a"},
giU(){return"\u0915\u093e\u0930\u094d\u0921 \u092e\u094d\u0939\u0923\u091c\u0947 \u092e\u091f\u0947\u0930\u093f\u092f\u0932 \u091a\u0940 \u090f\u0915 \u0936\u0940\u091f \u0906\u0939\u0947 \u091c\u0940 \u0915\u093e\u0939\u0940 \u0938\u0902\u092c\u0902\u0927\u093f\u0924 \u092e\u093e\u0939\u093f\u0924\u0940\u091a\u0947 \u092a\u094d\u0930\u0924\u093f\u0928\u093f\u0927\u093f\u0924\u094d\u0935 \u0915\u0930\u0923\u094d\u092f\u093e\u0938\u093e\u0920\u0940 \u0935\u093e\u092a\u0930\u0932\u0940 \u091c\u093e\u0924\u0947, \u0909\u0926\u093e\u0939\u0930\u0923\u093e\u0930\u094d\u0925 \u090f\u0916\u093e\u0926\u093e \u0905\u0932\u094d\u092c\u092e, \u092d\u094c\u0917\u094b\u0932\u093f\u0915 \u0938\u094d\u0925\u093e\u0928, \u091c\u0947\u0935\u0923, \u0938\u0902\u092a\u0930\u094d\u0915 \u0924\u092a\u0936\u0940\u0932 \u0907."},
giX(){return"\u0938\u0902\u0915\u094d\u0937\u093f\u092a\u094d\u0924 \u0918\u091f\u0915 \u0907\u0928\u092a\u0941\u091f, \u0935\u093f\u0936\u0947\u0937\u0924\u093e \u0915\u093f\u0902\u0935\u093e \u0915\u094d\u0930\u093f\u092f\u093e \u0938\u093e\u0926\u0930 \u0915\u0930\u0924\u093e\u0924"},
gcM(){return"\u0972\u0915\u094d\u0936\u0928 \u091a\u093f\u092a"},
